import React, { useState, useEffect } from "react";
import logo from "./images/logo.svg";
import kyle from "./images/kyle-bowtie.jpg";
import "./App.css";
import Banner from "./Banner";

function HeadShot() {
  <div id="head-shot"></div>
}

function Home() {
  const [currentTime, setCurrentTime] = useState(0);

  useEffect(() => {
    fetch("/time")
      .then((res) => res.json())
      .then((data) => {
        setCurrentTime(data.time);
      });
  }, []);

  return (
    <div id="home" className="page-body">
      <img src={kyle} alt="head-shot" />
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
      <p>{currentTime}.</p>
    </div>
  );
}

export default Home;
